package sarangi.rakesh.leetcode;

import java.util.HashMap;
import java.util.Map;

public class ValidAnagram {

    public static void main(String[] args) {
        String s = "";
        String t = "";

        ValidAnagram validAnagram = new ValidAnagram();
        System.out.println(validAnagram.isAnagram(s, t));;
    }
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length())
            return false;
        Map<Character, Integer> sFMap = new HashMap<>(), tFMap = new HashMap<>();
        char sChar, tChar;
        for (int i = 0; i < s.length(); i++) {
            sChar = s.charAt(i);
            tChar = t.charAt(i);
            if (sFMap.containsKey(sChar)) {
                sFMap.put(sChar, sFMap.get(sChar) + 1);
            } else {
                sFMap.put(sChar, 1);
            }

            if (tFMap.containsKey(tChar)) {
                tFMap.put(tChar, tFMap.get(tChar) + 1);
            } else {
                tFMap.put(tChar, 1);
            }
        }

        for (int i = 0; i < s.length(); i++) {
            sChar = s.charAt(i);
            if (!sFMap.get(sChar).equals(tFMap.get(sChar)))
                return false;
        }
        return true;
    }
}
